import { FolderItem } from "./FolderItem";
const FolderTree = ({data}) => {
    return (
        <ul>
            {data.map((item) => {
                return (

                    <li key={item.key}><FolderItem fileItem={item}/></li>
                )
            })}
        </ul>

    )
}
export default FolderTree;
